import React from 'react';
import UseFetchExchange from '../Fetch/useFetchExchange';

function Test03({ firstCur, secondCur }) {

    // Fetching API
    const moneyAmount = parseInt(UseFetchExchange(firstCur, secondCur));
    console.log('first cur: ' + firstCur);
    console.log('second cur: ' + secondCur);

    return (
        <div>
            <h1>{moneyAmount}</h1>
        </div>
    );
}

export default Test03;
